function MtgCard(name, image){

    return (
    <div className="ui card eight wide column">
      <div className="image">
        <img src={image} alt="cardPic" />
      </div>
      <div className="name">
        <h3 className="header">{name}</h3>
      </div>

    </div>
    )
}

export default MtgCard;
